void character(unsigned int x, unsigned int y, unsigned char value)
{
	unsigned int pos = (unsigned int)(value - 32) * 16;
	unsigned int pixels = 0x0000;
	unsigned char grabbed = 0x00;
  
	for (unsigned int i=y; i<y+8; i++)
	{
		grabbed = character_bitmap[pos];
		pixels = 0x0000;
		
		for (unsigned int j=0; j<4; j++)
		{
			if ((grabbed & 0x03) > 0x00) pixels += 0xF000;
			
			if (j < 3)
			{
				grabbed = (grabbed >> 2);
				pixels = (pixels >> 4);
			}
		}
			
		screen[i * 80 + x] = pixels;
		
		grabbed = character_bitmap[pos+1];
		pixels = 0x0000;
		
		for (unsigned int j=0; j<4; j++)
		{
			if ((grabbed & 0x03) > 0x00) pixels += 0xF000;
			
			if (j < 3)
			{
				grabbed = (grabbed >> 2);
				pixels = (pixels >> 4);
			}
		}
		
		screen[i * 80 + x + 1] = pixels;
		
		pos += 2;
	}
};




